import React from 'react'
import ExerciseCard from './ExerciseCard';

function MyExercises({ exercises, onRemoveExercise }) {
    return (
            <ul className="cards">
            {exercises.map(exercise => 
                <ExerciseCard
                key={exercise.id}
                exercise={exercise}
                onExerciseClick={onRemoveExercise}
                />)}
        </ul>
    )
}

export default MyExercises;
